import {
  IonButton,
  IonChip,
  IonCol,
  IonDatetime,
  IonGrid,
  IonIcon,
  IonInput,
  IonItem,
  IonItemDivider,
  IonItemGroup,
  IonLabel,
  IonRow,
  useIonViewDidEnter,
} from "@ionic/react";
import { add, pin, remove, trash } from "ionicons/icons";
import React, { ReactComponentElement, useState } from "react";
import Connection from "../../mixins/Connection";

const ComplexForm: React.FC<{
  name: string;
  isDisabled: boolean;
  content: any;
}> = (props) => {
  const {
    name,
    stree1,
    street2,
    city,
    province,
    postalCode,
    telephoneNum,
    startTime,
    endTime,
    cellNum,
    agents,
    units,
  } = props.content;

  var num = 0;

  const [unitList, setUnitList] = useState<string[]>(units);
  const [counter, setCounter] = useState<number>();

  const addUnit = (e: any) => {
    if (e.key === "Enter" && e.target.value !== '') {
      unitList.push(e.target.value);
      setCounter(num+1);
      setUnitList(unitList);
      console.log(unitList);
      console.log(counter)
      e.target.value = '';
    }
  };

  const removeUnit = (e: any, unit: any) => {
    e.preventDefault();
    let temp:any = [];
      for(let i = 0; i < unitList.length; i++){
          if(unitList[i] !== unit){
              temp.push(unitList[i]);
          }
      }
      setUnitList(temp);
      console.log(temp);
  };
  const removeUnit2 = (e: any) =>{
    setUnitList(unitList.filter(unit =>{ 
        return unit !== e.target.value 
    }));
}


  const submitHandler = () => {};

  return (
    <IonGrid>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Complex Name</IonLabel>
            <IonInput value={name}></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Street 1</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Street 2</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>City</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Province</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
        <IonCol>
          <IonItem>
            <IonLabel>Postal code</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Telephone Number</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Operational Start Time</IonLabel>
            <IonDatetime displayFormat="+HH:mm" />
          </IonItem>
        </IonCol>
        <IonCol>
          <IonItem>
            <IonLabel>Operational End Time</IonLabel>
            <IonDatetime displayFormat="+HH:mm" />
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel>Cell Number</IonLabel>
            <IonInput></IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItemDivider>
            <IonLabel>Units</IonLabel>
          </IonItemDivider>
          {unitList !== [''] && unitList.map((unit) => (
            <IonChip key={counter}>
              <IonLabel>{unit}</IonLabel>
              <IonIcon icon={trash} onClick={(e)=>removeUnit(e, unit)}/>
            </IonChip>
          ))}
          <IonItem>
            <IonInput onKeyUp={(e) => addUnit(e)} />
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonButton type="submit" expand="block" onClick={submitHandler}>
            {props.name}
          </IonButton>
        </IonCol>
      </IonRow>
    </IonGrid>
  );
};

export default ComplexForm;
